  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Swanquarter National
  Wildlife Refuge outlines Refuge accomplishments from February through April of 1940.
  The report begins by summarizing the weather conditions during this period. Wildlife-
  including migratory birds and furbeareres- is also covered. Resource management
  is outlined; topics include timber removal. The public relations section of the
  report describes violations.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
